```

If you don't want to use an external library, you can implement a simple conversion for basic Markdown features (e.g., bold, italics, headers, links, and paragraphs). Here's a more lightweight implementation:

```cpp
#include <string>
#include <sstream>

std::string simpleMarkdownToHtml(const std::string& markdown) {
    std::string html;
    std::stringstream ss;

    bool inItalic = false;
    bool inBold = false;

    for (char c : markdown) {
        ss.str(""); // Reset stringstream
        switch (c) {
            case '`':
                if (inItalic) {
                    html += "</i>"; // End italic
                    inItalic = false;
                } else {
                    html += "<i>";
                    inItalic = true;
                }
                break;
            case '*':
                if (inBold) {
                    html += "</b>"; // End bold
                    inBold = false;
                }
                if (!inBold) {
                    html += "<b>";
                    inBold = true;
                }
                ss << "&nbsp;";
                html += ss.str();
                break;
            case '#':
                html += "<h" + std::to_string(c - '0') + ">";
                break;
            case '[': {
                size_t closeBracket = markdown.find(']', markdown.find(c) + 1);
                if (closeBracket != std::string::npos) {
                    std::string link = markdown.substr(markdown.find('"', markdown.find('[') + 1) + 1,
                                                     closeBracket - markdown.find('"', markdown.find('[') + 1) - 1);
                    html += "<a href=\"" + link + "\">" +
                            markdown.substr(markdown.find('"', markdown.find(']', closeBracket) + 1) + 1, closeBracket - markdown.find('"', markdown.find(']', closeBracket) + 1) - 1) +
                            "</a>";
                    markdown.erase(markdown.begin() + markdown.find('['), markdown.begin() + closeBracket + 1);
                }
                break;
            }
            default:
                if (inItalic) {
                    ss << "&lt;i&gt;" << c << "&lt;/i&gt;";
                    html += ss.str();
                    inItalic = false;
                } else if (inBold) {
                    ss << "&lt;b&gt;" << c << "&lt;/b&gt;";
                    html += ss.str();
                    inBold = false;
                } else {
                    html += c;
                }
        }
    }

    // Close any open tags
    if (inItalic) html += "</i>";
    if (inBold) html += "</b>";

    return html;
}
```

Please note that this implementation is limited and may not cover all Markdown features. For a more comprehensive conversion, it's recommended to use a dedicated Markdown parser library like the one mentioned at the beginning.

