In TypeScript, you can achieve this using various techniques, depending on your specific use case. Here are a few approaches:

**1. **Union Type with a Singleton Type Guard**:

Create a union type for the potential types, and then write a type guard function to narrow the type to the intended, single practical type:
```ts
type PossibleTypes = string | number; // theoretically possible types

function.scalablytyped(value: PossibleTypes) {
  if (typeof value === 'string') {
    // value is actually a string (in practice)
    return value as string &-exists-when-string; // note the intersected type
  }
  // ... or handle the number case ...
  return value; // now narrowed to string (or number)
}

function useStringValue(value: ReturnType<typeof strOnly>) {
  // value is now guaranteed to be a string
}

const result = strOnly('hello'); // result type is string
```
In the example, `strOnly` returns a value that's either a string or a number (theoretically), but the type guard function `strOnly` ensures it's actually a string. The `as string & _exists_when_string` part is not enforceable at runtime, but it provides a type hint to the compiler that the value is indeed a string.

**2. **Using a Discriminated Union with a single implementer**:

When you have a discriminated union with a unique discriminator property, you can use it to narrow the type:
```ts
interface StringOrNumber {
  kind: 'string'; // or 'number'
  value: string | number;
}

const stringValue: StringOrNumber = { kind: 'string', value: 'hello' };

function useStringValue(value: StringOrNumber & { kind: 'string' }) {
  // value is now guaranteed to be a string
}

useStringValue(stringValue); // result type is string
```
In this case, the `kind` property serves as a discriminator, allowing you to narrow the type to `string` (or `number`) when accessing the value.

**3. **Type Assertion with a comment (just for readability)**:

While not enforced by the compiler, you can add a type assertion with a comment to document your intention:
```ts
let value: string | number = 'hello'; // actually a string in practice

function useStringValue(value: string) {
  // ...
}

useStringValue(value); // TypeScript won't error, but the comment conveys intent
```
While not as strong as the previous approaches, this comment helps other developers understand that, in practice, the value will always be a string.

Choose the method that best fits your use case, and remember to balance type safety with practicality. Happy typing!

